import { useEffect } from "react";

function Home(){

    
    let theUser = null;

    useEffect(()=>{

        let json;
        async function fetchData(){ 
        let response = await fetch('/api/home')
        json = await response.json()
        //console.log(json)
        if(response.ok){
            
            if(json.toLink !== ''){
                window.location.href = json.toLink;
            }

         
            
        }

        theUser = json.thisUser
        console.log(theUser)

       
    }


    
    fetchData();

   

    }, [])

    return(
        <>
            <div className="container" id = "">
               <h3>{JSON.stringify(theUser)}</h3>
            </div>
        </>
    );

}

export default Home;
